import React, {useEffect, useState} from 'react'
import PhotoAlbum from "react-photo-album";
import { photos } from "./photos";

const ImageMars = () => {

    const [images, setImages] = useState([]);

    useEffect(() => {
        api();
    }, [])

    const api = async()=> {

        const url = "https://api.nasa.gov/mars-photos/api/v1/rovers/curiosity/photos?sol=1000&api_key=2XmkxjQnMoob5xli1MzHey9cc5xQJxe6i8sVofNF";
        const res = await fetch(url);
        const data = await res.json();
        console.log(data)
        const dataShowImage = data.photos.slice(0,3).map( response => {
            return {
                Photos: response.img_src
            }
        });
        setImages(dataShowImage)
        console.log(dataShowImage)
    }


    return (
        <div>
            {
                images.slice(0, 4).map( ({ Photos }) => {
                    return (
                        <PhotoAlbum layout="rows" photos={Photos} />
                    )
                })
            }
        </div>
    )
}

export default ImageMars
